import React from 'react';
import Slider from 'react-slick';
import { useAppSelector } from '../../store/storeHooks';

let trendingSettings = {
    infinite: false,
    speed: 500,
    slidesToShow: 4,
    slidesToScroll: 1,
    arrows: false,
};

const TrendingSlider = () => {

    const trendingSliderData = useAppSelector(state => state?.homeData);
    console.log("trendingSliderData==>", trendingSliderData)

    return (
        <>
            <section className="trending-services">
                <div className="container">
                    <Slider {...trendingSettings}>
                        {
                            trendingSliderData ? trendingSliderData.subcategoryData?.map((trendingData: any, index: number) => {
                                return (
                                    <div className="card" key={index}>

                                        <div className="service-img"><img
                                            src="https://inszn-ecom.s3.amazonaws.com/986075f1-aee4-427c-841d-b300a8f42dfd.jpeg" alt="service" style={{ width: "500px", height: "350px" }} />
                                        </div>
                                        <div className="service-name">
                                            <h3>{trendingData.name}</h3>
                                        </div>

                                    </div>
                                )
                            }) : null
                        }
                    </Slider>

                    {/* <button type="button" data-role="none"
                        className="slick-arrow slick-prev slick-disabled" style={{ display: "block" }}>
                        Previous
                    </button>

                    <button type="button" data-role="none" className="slick-arrow slick-next" style={{ display: "block" }}>
                        Next</button> */}

                </div>
            </section>
        </>
    )
}

export default TrendingSlider
